column8:
パステルカラーのマップ柄がおしゃれなポーチ。<br>
化粧ポーチやバッグインバッグ、ペンシルケースとして使えます。<br>
外側はコットン100％、内側は少し起毛したポリエステル100％なのでとても手触りが良く、中身を優しく守ります。<br>
裏面はシンプルな無地色です。<br>
別売りのEMBROIDERY SEALと組み合わせれば、自分だけの地図がを作れて、より一層楽しめます。
<br>
<b>【　仕　様　】</b><br>
カラー：グリーン、イエロー、ピンク<br>
素材: 表地／コットン100％　裏地／ポリエステル100％<br>
サイズ：w180 d10 h110mm<br>
パッケージ：w200 h120<br>
<br>

