おしゃれなパパ・ママが普段使いに使えるバッグとして開発された「バカンスキルト」シリーズ。<br>
アースカラーのキャンバス生地は、ジーンズのように使い込むことで増していく柔らかな風合いが楽しめます。<br>
丈夫な厚手コットンキャンバス生地に、耐久性を高めたこだわりのキルティングは、大きな丸い模様が印象的。<br>
コンパクトカメラや、スマホ・パソコンの周辺機器、旅行時の小物のケースとしてピッタリなサイズです。<br>
<br>
<b>【　仕　様　】</b><br>
カラー：カーキ、キャメル<br>
素材：生地／綿100％ (キャンバス)　クッション材／ポリエステル<br>
サイズ：w180 h150mm<br>
<br>

